I’ve never filmed a movie before with someone I’m romantically involved with, and I’m so happy I got to fall in love with you on screen and off screen a million times over.
If you love romance movies “Time Is Up” is the one for you! 🍿❤️ We wanted to do a very special preview screening for our fans.. we’ll see you in selected theaters on the 9th of September. 
